import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav className="navbar">
            <Link to="/">Home</Link>
            <Link to="/wishlist">Wishlist</Link>
        </nav>
    );
};

export default Navbar;
